import React from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCloud } from '@fortawesome/free-solid-svg-icons';
import './navigation.css'

const Container = styled.div`
display: flex;
justify-content: space-evenly;
align-items: center;
background-color: #00B2EE;
margin:1rem;
border-radius: 10px;
color:white;
border: #003F87 solid 1px;
`
const ContainerLogo = styled.div`
display: flex;
justify-content: flex-start;
align-items: center;
padding:.3rem;
text-shadow: -1.5px -1.5px 0 #003F87, 1.5px 1.5px 0 #003F87, 0 -1.5px 0 #003F87,
	0 1.5px 0 #003F87, 1.5px -1.5px 0 #003F87, -1.5px 1.5px 0 #003F87, 1.5px 0 0 #003F87,
    -1.5px 0 0 #003F87; 
letter-spacing: 1px;
font-size:1.5rem;
`

function Navigation (){
    function mouseOver (e) {
        e.target.style.transform = 'scale(1.2)' 
        e.target.style.transition= '.3s';
    }

    // teamUp.addEventListener('mouseleave', ()=>{
    //     teamUp.style.transform = 'scale(1.0)';
    //     teamUp.style.transition= '.3s';


    return (
        <Container>
            <ContainerLogo>
                <FontAwesomeIcon icon={faCloud} className='cloud-icon' />
                <h1>School in the Cloud</h1>
            </ContainerLogo>
            <div>
                <Link onMouseEnter={mouseOver} className='links' to='/login'>Login</Link>
            </div>
            <div>
                <Link className='links' to='/sign-up'>Sign-Up</Link>
            </div>
        </Container>
    )
}


export default Navigation;
